import React from 'react'

export default class LockButton extends React.Component {

    constructor(props) {
        super(props);
    }

    render() {
        return(
            <div id='popup' onClick={this.props.closePopUp}>
                <p>Enter admin password to update database</p>
                <input type='text'></input>
            </div> 
            )
    }
}
